import React, { Fragement } from 'react';
import mealsImg from '../../assets/meals';
import classes from './Header.module.css';

const Header = (props) => {
    return <Fragement>
        <header className={classes.header}>
            <h1>ReactMeals</h1>
            <button>Cart</button>
        </header>
        <div className={classes['main-image']}>
            <img src={mealsImg} alt='table full of delicious foods'/>
        </div>
    </Fragement>
};

export default Header;
